import {  Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <div id="navBar">
        <Link to="/cities">CITIES</Link>
        <Link to="/drives">DRIVES</Link>
        <Link to="/blogs">BLOG</Link>
        <Link to="/partners">PARTNERS</Link>
      </div>
    </>
  )
};

export default Layout;
